import React from 'react';
import './Button.css';

const Button = (props) => {
  const handleClick = () => {
    if (props.onClick) {
      props.onClick();
    }
  };

  return (
    <div>
      <button className={props.className} onClick={handleClick}>
        {props.icon && <props.icon className="inline-block w-4 h-4 mr-1" />}
      </button>
    </div>
  );
};

export default Button;
